import React from 'react'

export const NotePost = (props) => {
    const label = props.notes.important? 'make not important' : 'make important'

    return <form>
        {props.notes.map(e=>{
            {console.log("E.ID", e.id)}
            return <ul>
                <li>
                    {e.content}
                </li>
                <button
                    type='submit' 
                    onClick={(e)=> {
                        e.preventDefault()
                        props.toggleImportanceOf(e.id)
                        }}>{label}</button>
                <br></br>
            </ul>
    })}

    </form>
  }
